B.oz=A.a(s(["Fifty years ago, deep within the lush Wilderness settings, an imminent threat suddenly appeared on the earth. Numerous polluting beings in the form of smog and sludge were spreading and beginning to invade entire countries. These noxious monsters were the result of human negligence and indifference towards nature. They endangered the delicate balance of the ecosystem and threatened the lives of billions of living beings.","In the midst of this chaos, a hero was born \u2013 he is called Eco-Hero. Eco-Hero is a unique creature born from the force of nature and the environmental consciousness of some humans. He travels through ravaged lands to restore the harmony of nature and defeat the forces of pollution.","To accomplish his mission, the wisdom of the earth endowed him with extraordinary agility and fierce determination. He has the ability to leap over the tallest obstacles.","This entity also bestowed upon him two magical powers. One is the ability to release spheres of purity, a natural energy to dissipate pollution and restore the vitality of the earth. The other is the power to communicate with animals and imbibe their abilities. Along his journey, birds, wolves, and squirrels offer him their assistance, granting him the ability to fly and providing him with seeds of new life.","With these newfound abilities, our hero will push back pollution, plant trees, gather fruits, and recycle waste. He stands as a beacon of hope in this chaotic world, inviting us to join him in this ultimate battle for a greener and cleaner world.","Credits","Protagonist sprites by Penzilla: https://penzilla.itch.io/hooded-protagonist","Tileset by Jesse Munguia: https://jesse-m.itch.io","Animal sprite by Kacper Wo\u017aniak: https://itch.io/profile/thkaspar","Enemies and fruits sprite by Pixel Frog: https://pixelfrog-assets.itch.io"]),t.s)
