B.rt=A.a(s(["Il y a cinquante ans, au c\u0153ur des for\xeats luxuriantes, une menace imminente est soudainement apparue sur terre. De nombreuses entit\xe9s polluantes sous forme de brouillard et de boue se r\xe9pandaient et commen\xe7aient \xe0 envahir des pays entiers. Ces monstres toxiques \xe9taient le r\xe9sultat de la n\xe9gligence et de l'indiff\xe9rence des humains envers la nature. Ils mettaient en danger l'\xe9quilibre d\xe9licat de l'\xe9cosyst\xe8me et mena\xe7aient la vie de milliards d'\xeatres vivants.","Au milieu de ce chaos, un h\xe9ros est n\xe9 \u2013 il s'appelle Eco-Hero. Eco-Hero est une cr\xe9ature unique n\xe9e de la force de la nature et de la conscience environnementale de certains humains. Il voyage \xe0 travers des terres ravag\xe9es pour r\xe9tablir l'harmonie de la nature et vaincre les forces de la pollution.","Pour accomplir sa mission, la sagesse de la terre l'a dot\xe9 d'une agilit\xe9 extraordinaire et d'une d\xe9termination f\xe9roce. Il a la capacit\xe9 de sauter par-dessus les plus grands obstacles.","Cette entit\xe9 lui a \xe9galement accord\xe9 deux pouvoirs magiques. L'un est la capacit\xe9 de lib\xe9rer des sph\xe8res de puret\xe9, une \xe9nergie naturelle pour dissiper la pollution et restaurer la vitalit\xe9 de la terre. L'autre est le pouvoir de communiquer avec les animaux et d'absorber leurs capacit\xe9s. Tout au long de son voyage, les oiseaux, les loups et les \xe9cureuils lui offrent leur aide, lui permettant de voler et de lui fournir des graines de nouvelle vie.","Avec ces nouvelles capacit\xe9s, notre h\xe9ros repoussera la pollution, plantera des arbres, r\xe9coltera des fruits et recyclera les d\xe9chets. Il est un symbole d'espoir dans ce monde chaotique, nous invitant \xe0 le rejoindre dans cette bataille ultime pour un monde plus vert et plus propre.","Cr\xe9dits","Sprites du protagoniste par Penzilla : https://penzilla.itch.io/hooded-protagonist","Tileset par Jesse Munguia : https://jesse-m.itch.io","Sprite d'animaux par Kacper Wo\u017aniak : https://itch.io/profile/thkaspar","Sprites des ennemis et des fruits par Pixel Frog : https://pixelfrog-assets.itch.io"]),t.s)
