B.ud=A.a(s(["Telo-polo taona lasa izay, tao anatin'ireo toerana be ala sy maitso mavana, nisy loza mitatao nipoitra tampoka teto an-tany. Zavaboary maro mpandoto toy ny zavona sy fotaka no niely ary nanomboka nanafika firenena manontolo. Ireo zavaboary mahafaty ireo dia vokatry ny tsy firaharahiana sy ny tsy fanajana ny tontolo iainana ataon'ny olombelona. Nampidi-doza ny fifandanjan\u2019ny ek\xf4sistema ireo ary nanohintohina ny ain\u2019ny zavamananaina an-tapitrisany.","Teo anivon'ity korontana ity, teraka ny maherifo iray \u2013 antsoina hoe Eco-Hero izy. Eco-Hero dia zavaboary tokana teraka avy amin'ny herin'ny natiora sy ny fahatsiarovan-tenan'ny olona sasany momba ny tontolo iainana. Mandalo amin\u2019ny tany simba izy mba hampodiana ny fifandanjan\u2019ny natiora ary handresy ny hery mpandoto.","Mba hanatanterahana ny iraka, nomen'ny fahendren'ny tany azy ny hakingana tsy manam-paharoa sy ny fahavononana mahery. Manana ny fahafahana mitsambikina mihoatra ny sakana avo indrindra izy.","Ity zavaboary ity koa nanome azy hery roa mahagaga. Ny iray dia ny fahaizana mamoaka boribory mamirapiratra, herin'ny natiora manadio ny fandotoana sy manarina ny herin'ny tany. Ny faharoa dia ny hery hifandray amin'ny biby ary hahazo ny heriny. Mandritra ny diany, ny vorona, ny amboadia, ary ny boloky dia manampy azy, manome azy ny hery hianika sy hanome voan-javamaniry vaovao.","Miaraka amin'ireto fahaiza-manao vaovao ireto, ny maherifontsika dia hanary ny fandotoana, hamboly hazo, hanangona voankazo, ary hanodina fako. Izy dia mariky ny fanantenana ao amin'ity tontolo feno korontana ity, manasa antsika hiaraka aminy amin'ity ady faratampony ho an'ny tontolo maitso sy madio ity.","Fankasitrahana","Sary masina ny maherifo nataon'i Penzilla: https://penzilla.itch.io/hooded-protagonist","Tileset nataon'i Jesse Munguia: https://jesse-m.itch.io","Sary biby nataon'i Kacper Wo\u017aniak: https://itch.io/profile/thkaspar","Sarin'ireo fahavalo sy voankazo nataon'i Pixel Frog: https://pixelfrog-assets.itch.io"]),t.s)
