B.Xa=A.a(s(["Sakafo fako feno loto nangonina tao anaty zaridaina na eny amoron-dranomasina.","Sary alohan'ny sy aorian'ny fanadiovana faritra voapohana.","Mpilalao manangona fako miaraka amin'ny fonon-t\xe0nana sy sakafo fako.","Lalana na l\xe0lana fitetezana vao avy nodiovina.","Fako zaraina ho an'ny famerenana.","Boky famerenana feno tavoahangy plastika sy tavoahangy.","Mpilalao manadio renirano na farihy.","Vondron'olona mandray anjara amin'ny hetsika fanadiovana vondrom-piarahamonina.","Mpilalao manangona ireo tady sigara miaraka amin'ny ashtray kely.","Zaridaina na efitra filalaovana madio aorian'ny fanadiovana.","Fako elektronika nalefa any amin'ny foibe famerenana mety.","Mpilalao manadio fako navelan'ny piknik.","Sary mampahafantatra ny olana momba ny fako sy ny fiantraikany amin'ny tontolo iainana.","Mpilalao mampiasa mpanangona fako telescopique hanangona fako.","Fako iombonana voarindra sy feno tsara.","Mpilalao manadio ny fako an'ny biby ao anaty zaridaina.","Sary maneho ny maha-zava-dehibe ny fampihenana, ny famerenana, ary ny famerenana indray.","Mpilalao manadio graffiti na stickers amin'ny toerana p\xfablica.","Hetsika fanadiovana amoron-dranomasina nokarakarain'ny fikambanana eo an-toerana.","Mpilalao manangona fako any anaty ala na faritra voajanahary."]),t.s)
B.QB=A.a(s(["Mpilalao mametraka hazo na zavamaniry ao amin'ny zaridainany na toerana p\xfablica.","Vondron'olona mandray anjara amin'ny hetsika fanamboarana hazo na fanarenana ny ala.","Sary alohan'ny sy aorian'ny fametrahana hazo na fanamboarana faritra maitso.","Voankazo na zana-kazo vonona hapetraka.","Hazo vao napetraka misy fitehirizana.","Mpilalao mandraisa rano hazo na zavamaniry vao napetraka.","P\xe9pini\xe8re feno zana-kazo tanora.","Zaridaina vondrom-piarahamonina na tavy organika.","Mpilalao mametraka voninkazo an-tan\xe0na hanohanana ny karazana biolojika.","Faritra maitso nohavaozina aorian'ny afo na loza voajanahary.","Hazo voankazo napetraka ao anaty zaridaina na zaridaina.","Mpilalao mamorona trano fandraisana bibikely na tohana ho an'ny biby.","Faran'ny hazo voajanahary napetraka mba hanome habitat ho an'ny biby sy hampihena ny fivoarana.","Tetikasa zaridaina vertical na tafo maitso.","Mpilalao mametraka zavamaniry voajanahary hanohana ny ekosisteman'ny faritra.","Ala iray manatsara noho ny ezaka fanarenana.","Mpilalao mandray anjara amin'ny atrikasa momba ny fametrahana sy ny fikarakarana hazo.","Sary maneho ny maha-zava-dehibe ny hazo sy ny ala ho an'ny fahasalamam-bahoaka.","Tetikasa zaridaina any an-tsekoly na vondrom-piarahamonina.","Mpilalao mametraka hazo ao anatin'ny programa fanalefahana ny entona karbonika."]),t.s)
B.Ud=A.a(s(["Mpilalao mampiasa bisikileta, trottinette, na roller ho fomba fitaterana mahasoa ny tontolo iainana.","Sary misy zaridaina legioma organika na compost ao an-trano.","Panneaux solaires na turbine \xe0 vent napetraka amin'ny trano na zaridaina.","Mpilalao mampiasa tavoahangy azo ampiasaina indray na kitapo landy ho an'ny fividianana.","Fiara elektrika na hybride napetraka ao amin'ny station de recharge.","Mpilalao mampiasa ny fitateram-bahoaka (bus, train, tram) fa tsy mitondra fiara.","Trano iray efa voahodina amin'ny rafitra fanamainana sy fandrahoana mahasoa ny tontolo iainana (pompe \xe0 chaleur, g\xe9othermie).","Mpilalao manao sakafo vegetarian na vegan hanampiana amin'ny fihenan'ny entona karbonika.","Ampoule LED mahasoa ny tontolo iainana ampiasaina ao an-trano na birao.","Mpilalao manamboatra na manome aina indray ny zavatra fa tsy mandrava azy ireo.","Rafitra fanangonana rano rain'ny orana napetraka ho an'ny fanondrahana ny zaridaina.","Mpilalao mandray anjara amin'ny hetsika tsy misy fako na fako.","Sary maneho ny maha-zava-dehibe ny fampihenana ny famoahana angovo sy rano.","Mpilalao manao covoiturage hanampy amin'ny fihenan'ny CO2.","Trano na birao efa voahodina amin'ny fitaovana manakana ny rano (fikirakirana, trano fidiovana fotsiny).","Mpilalao mampiasa vokatra fanadiovana mahasoa ny tontolo iainana sy tsy misy poizina.","Sary mampiseho ny fampiasana fitaovana elektronika mahasoa ny angovo (ordinateur, finday, TV).","Mpilalao mandray anjara amin'ny atrikasa momba ny fiainana maharitra sy ny fomba fanao mahasoa ny tontolo iainana.","Orinasa eo an-toerana manolo-tena amin'ny fomba fanao maharitra sy manaja ny tontolo iainana.","Mpilalao manentana ny vahoaka momba ny olana momba ny tontolo iainana sy ny vahaolana mahasoa ny tontolo iainana ao amin'ny fiarahamonina."]),t.s)
